import logo from './logo.svg';
import {Image} from "./components/Image/image";

function App() {
  return (
    <div className="App">

      <header className="App-header">
          <Image/>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
            coś tu trzeba wyświetlić
        </p>
          <Image/>

      </header>
    </div>
  );
}

export default App;
